    [],nt"revision_timestamp": "2015-04-25T12:25:22.543276",nt"name": "wildlife-linkages-san-joaquin-valley-ds417608eb",nt"isopen":
    false,nt"url": null,nt"notes": "The California Departments of Fish and
    Game, Parks and Recreation, and Transportation (Caltrans) are collaborating to improve
    planning information for wildlife connectivity statewide. The results of an inquiry
    to identify existing information on wildlife corridors in California produced eight
    data sets covering three parts of California and a single statewide data set. Not
    all data sets represent the same data gathering and analysis criteria for designating
    corridors. The data set groups and their creators are: Statewide Corridors, by South
    Coast Wildlands - one data set. Central California Coast Corridors, by Univ. of
    California, Davis - one data set. San Joaquin Valley Corridors, by Endangered Species
    Recovery Program - three data sets. San Joaquin Valley Corridors, by Information
    Center for the Environment - two data sets. Southern California Corridors, by South
    Coast Wildlands - one data set. The data set proposes areas where connectiviy and
    linkages between isolated habitat on the San Joaquin Valley floor and natural lands
    in the surrounding foothills should be promoted. The information was put together
    by the Endangered Species Recovery Program and incorporated with the federal recovery
    plan produced by the U.S. Fish and Wildlife Service. Reference: U.S. Fish and Wildlife
    Service. 1998. Recovery plan for upland species of the San Joaquin Valley, California
    . Region 1, Portland, OR. 319 pp.",nt"license_title": null,nt"extras":
